import React, { useState } from "react";
import {
  View,
  TextInput,
  StyleSheet,
  Text,
  TouchableOpacity as TO,
} from "react-native";
import Entrada from "../components/Entrada";

export default function SingUp() {
  const [textName, setName] = useState(" ");
  const [textData, setData] = useState(" ");
  const [textPhone, setPhone] = useState(" ");
  const [textCPF, setCPF] = useState(" ");
  const [textStd, setStd] = useState(" ");
  const [textCity, setCity] = useState(" ");
  const [textGenre, setGenre] = useState(" ");

  const next = "Próximo";

  return (
    <>
      <View style={styles.container}>
        <View>
          <Text style={styles.title}>Digite seus dados para se cadastrar</Text>
        </View>
        <View>
          <Entrada label='Nome Completo' setValue={setName} value={textName}/>
          <Entrada label='Data de Nascimento' setValue={setData} value={textData}/>
          <Entrada label='Telefone' setValue={setPhone} value={textPhone}/>
          <Entrada label='CPF' setValue={setCPF} value={textCPF}/>
          <Entrada label='Estado' setValue={setStd} value={textStd}/>
          <Entrada label='Cidade' setValue={setCity} value={textCity}/>
          <Entrada label='Gênero' setValue={setGenre} value={textGenre}/>
  

          <Text style={styles.text}>Data de Nascimento</Text>
          <TextInput
            style={styles.box}
            onChangeText={(e) => setData(e)}
            value={textData}
            placeholder="Data Nascimento"
          />

          <Text style={styles.text}>Telefone</Text>
          <TextInput
            style={styles.box}
            onChangeText={(e) => setPhone(e)}
            value={textPhone}
            placeholder="Telefone"
          />

          <Text style={styles.text}>CPF</Text>
          <TextInput
            style={styles.box}
            onChangeText={(e) => setCPF(e)}
            value={textCPF}
            placeholder="CPF"
          />

          <Text style={styles.text}>Estado</Text>
          <TextInput
            style={styles.box}
            onChangeText={(e) => setStd(e)}
            value={textStd}
            placeholder="Estado"
          />

          <Text style={styles.text}>Cidade</Text>
          <TextInput
            style={styles.box}
            onChangeText={(e) => setCity(e)}
            value={textCity}
            placeholder="Cidade"
          />

          <Text style={styles.text}>Gênero</Text>
          <TextInput
            style={styles.box}
            onChangeText={(e) => setGenre(e)}
            value={textGenre}
            placeholder="Gênero"
          />
        </View>
        <View>
          <TO style={styles.to}>
            <Text>{next}</Text>
          </TO>
        </View>

        <View>
          <Text style={styles.text}>Já se cadastrou? Entrar</Text>
        </View>
      </View>
    </>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#83A1EF",
    justifyContent: "center",
    alignItems: "center",
  },
  lugar: {},
  title: {
    fontSize: 30,
    color: "white",
  },
  box: {
    paddingLeft: 5,
    marginBottom: 5,
    width: 250,
    height: 40,
    borderColor: "black",
    borderWidth: 1,
    borderRadius: 10,
  },
  to: {
    borderColor: "black",
    borderWidth: 1,
  },
  text: {
    color: "white",
  },
});
